function FizzBuzz(num){	
num.map((x) => {
	let number = x+1;
	return console.log(
	(number % 3 === 0 && number % 5 === 0) ?
		"fizzBuzz" : (number % 5 === 0 ?
				"buzz" : (number % 3 === 0 ?
					"fizz" : number)
					)
				);
})
};
export default FizzBuzz;
